  input: 'TEXT,F3A,,"This amendment corrects the following:  1) Corrects Summary page
    for Columns B and C; 2) Please note that contributions from the Zarrow family
    are as follows as it relates to 48 Hour report that was filed on January 4, 2002:  On
    the 48 Hour report the Mrs. before Jack Zarrow was inadvertent and was from Mr.
    Jack Zarrow.  Hillary Zarrow is the spouse of Scott Zarrow and the contribution
    was inadvertently recorded as a $2,000 contribution from Scott Zarrow on the 48
    Hour report instead of $1,000 each from Scott and Hillary Zarrow; 3) A 48 Hour
    report was sent for Dr. Greg Gray based upon a contribution pledge.  This contribution
    was never received by the committee; 4) The contribution from the Ironworkers
    Political Action League was inadvertently omitted from the Post-election report
    and is included in this amended report; 5) All occupation and employers for itemized
    contributors have been disclosed; 6) An adjustment to the amount owed to Doug
    Dodd has been made and a debt owed to Elaine Dodd, which was inadvertently omitted
    from the last report has been included; 7) A memo schedule regarding in-kind contributions
    from Elaine and Doug Dodd for Staff advances has been included; 8) An payment
    to Cory Scheer, which was inadvertently omitted from the previous report has been
    included; 9) In-kind contributions received from Elaine Dodd&Robert Billings have
    been included."'
